import React from 'react';
import {Formik} from 'formik';
import Form from './Form';
function Formik1()
{
    return(
      <Formik
      initialValues={
          {FirstName:''}
      }
      onSubmit={
          (values)=>
          {
              console.log("The values are",values);
          }
      }
      render={Form}
      >

      </Formik>
    );
}
